import React, { useState, useEffect } from 'react'

function App() {
    const [info, setInfo] = useState([])

    useEffect(() => {
        fetch('http://localhost:4000/doubleSpeak')
            .then((r)=>r.json())
            .then((stuff)=>setInfo(stuff))
    }, [])

    console.log(info)

    return(
        info.map(i=>
        <div>
            <h1 key={i.jargon}>{i.jargon}</h1>
            <iframe src={i.image} width="480" height="480" frameBorder="0"></iframe>
        </div>
    ))
}
export default App
